import React from 'react'
import Manifest from './manifest.json'

const TextBlocks = () => {
    var text = Manifest.main
    return(
    <div className='space-y-5'>
        {text.split('/n').map((i,key) => {
            return <div key={key}>{i}</div>;
            })}
        </div>
    )
}

const Tokenomics = () => { 
    return (
    <div className='grid md:grid-flow-col text-white p-7 md:gap-x-10 bg-black'>
        <div className='grid grid-flow-row mb-7'>
            <div className='font-extrabold text-sm opacity-50 mb-9'>{Manifest.heading}</div>
            <div className=''>
                <div className='font-extrabold text-3xl mb-3 opacity-90 md:text-5xl md:mb-7'>{Manifest.title}</div>
                <div className='font-normal text-base leading-snug opacity-90 md:text-base'><b>STAGELINK </b></div>
            </div>
        </div>
        <div className='bg-white bg-opacity-10 rounded-xl p-5'>
            {Manifest.content.map((i, key) => {
                return <Section key={key} data={i}/>;
                })}
        </div>
    </div>
    )
}

export default Tokenomics
